/*Table structure for table `member` */

DROP TABLE IF EXISTS `member`;

CREATE TABLE `member` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户表',
  `name` varchar(10) DEFAULT NULL COMMENT '昵称',
  `username` varchar(20) DEFAULT NULL COMMENT '账号',
  `password` varchar(64) DEFAULT NULL COMMENT '密码',
  `phone` varchar(20) DEFAULT NULL COMMENT '手机号',
  `status` int(1) DEFAULT '0' COMMENT '是否封号 0 否 1 是',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `balance` decimal(8,2) DEFAULT '0.00' COMMENT '余额',
  `head` varchar(255) DEFAULT NULL COMMENT '头像',
  `province` int(11) DEFAULT NULL COMMENT '省份ID',
  `city` int(11) DEFAULT NULL COMMENT '城市ID',
  `street` int(11) DEFAULT NULL COMMENT '区县ID',
  `address` varchar(30) DEFAULT NULL COMMENT '具体地址',
  `full_address` varchar(50) DEFAULT NULL COMMENT '地址全称',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

