/*Table structure for table `product` */

DROP TABLE IF EXISTS `product`;

CREATE TABLE `product` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '商品表',
  `name` varchar(1000) DEFAULT NULL COMMENT '商品名称',
  `category_id` int(11) DEFAULT NULL COMMENT '商品分类',
  `price` decimal(8,2) DEFAULT NULL COMMENT '商品金额',
  `discount_price` decimal(8,2) DEFAULT '0.00' COMMENT '优惠价格； 大于 0 则有优惠，否则无优惠',
  `freight_price` decimal(8,2) DEFAULT '0.00' COMMENT '运费价格； 大于 0 则由买家支付，否则免运费',
  `payment_type` int(1) DEFAULT '0' COMMENT '0 余额支付',
  `quantity` int(11) DEFAULT NULL COMMENT '库存',
  `detail` text COMMENT '商品详情',
  `status` int(1) DEFAULT '1' COMMENT '是否上架 0 否 1 是',
  `hot` int(1) DEFAULT '0' COMMENT '是否是热门商品 0 否 1 是',
  `create_time` datetime DEFAULT NULL COMMENT '商品创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `product` */

/*Table structure for table `product_category` */

DROP TABLE IF EXISTS `product_category`;

CREATE TABLE `product_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '商品分类表',
  `name` varchar(1000) DEFAULT NULL COMMENT '分类名称',
  `icon` varchar(255) DEFAULT NULL COMMENT '分类图标',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `product_category` */

/*Table structure for table `product_comment` */

DROP TABLE IF EXISTS `product_comment`;

CREATE TABLE `product_comment` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '商品评论表',
  `pid` int(11) DEFAULT NULL COMMENT '商品ID',
  `mid` int(11) DEFAULT NULL COMMENT '用户ID',
  `comment` text COMMENT '用户评论',
  `core` int(11) DEFAULT NULL COMMENT '用户评分',
  `name` varchar(255) DEFAULT NULL COMMENT '用户名称',
  `create_time` datetime DEFAULT NULL COMMENT '评论时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `product_comment` */

/*Table structure for table `product_img` */

DROP TABLE IF EXISTS `product_img`;

CREATE TABLE `product_img` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '商品图片表',
  `pid` int(11) DEFAULT NULL COMMENT '商品ID',
  `img` varchar(255) DEFAULT NULL COMMENT '商品图片',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `product_img` */

/*Table structure for table `province` */

