DROP TABLE IF EXISTS `sys_users`;

CREATE TABLE `sys_users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '后台用户表',
  `username` varchar(50) DEFAULT NULL COMMENT '用户登录名',
  `name` varchar(50) DEFAULT NULL COMMENT '用户名称',
  `password` varchar(100) DEFAULT NULL COMMENT '密码',
  `create_time` datetime DEFAULT NULL COMMENT '用户创建日期',
  `last_login_time` datetime DEFAULT NULL COMMENT '最后登录日期',
  `last_login_ip` varchar(23) DEFAULT NULL COMMENT '最后登录IP',
  `enabled` int(1) DEFAULT '1' COMMENT '是否可用，1可用，0不可用',
  `head` varchar(255) DEFAULT NULL COMMENT '头像',
  `type` int(11) DEFAULT '2' COMMENT '账号类型:  1 管理员,  2 企业用户',
  `verify_code` varchar(10) DEFAULT NULL COMMENT '验证码',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=270 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;

